import React from 'react'
import '../css/Navigation.css'

export const Navigation = () => {
    return (
        <div>
            <li>Home</li>
            <li>About</li>
            <li>Skills</li>
            <li>Experience</li>
            <li>Portfolio</li>
            <li>Home</li>
        </div>
    )
}
export default Navigation;
